import { FC } from 'react';
import AppProvider from '../../store/provider/app';
import StatsProvider from '../../store/provider/stats';

const Wrapper: FC = ({ children }) => (
    <AppProvider>
      <StatsProvider>
        { children }
      </StatsProvider>
    </AppProvider>
);

export default Wrapper;
